import React from 'react';
import Theme from './theme/theme';
import GlobalStyles from './theme/GlobalStyles';

function App() {
  return (
    <Theme>
      <GlobalStyles />
      <div className='App'>APP</div>
    </Theme>
  );
}

export default App;
